INSERT INTO `evt_article_1` VALUES (1, NULL, NULL, NULL, '近来，台海局势紧绷。台湾《中国时报》评论指出，520之后，大陆军机到台海上空如同逛自家厨房，很明显，大陆应对民进党当局的策略又进到新阶段，在军事上，意图让两岸的“台海边界”模糊化，在政治上，则是一中清楚化，逐渐没有模糊空间。', 'a:5:{i:0;s:48:\"/images/article/20200902/402838765e7ea0e6737.jpg\";i:1;s:48:\"/images/article/20200902/8596e6f96afe3a16617.jpg\";i:2;s:48:\"/images/article/20200902/dc30743db98df339977.jpg\";i:3;s:48:\"/images/article/20200902/6616683da6e6aaaf259.jpg\";i:4;s:48:\"/images/article/20200902/583e07fb2c5dfd57913.jpg\";}', '<img src=\"[IMG_URL]/images/article/20200830/ce86c1a2d91dba30228.jpg\" alt=\"\" /><img src=\"[IMG_URL]/images/article/20200830/53e4efb3a90a37a3518.png\" alt=\"\" />', NULL);
